import React from 'react';
import '../style/calendrier.css';

function Calendrier() {
  return (
    <div className="Calendrier">
      <div className="case">
          Case 1
      </div>
      <div className="case">
          Case 2
      </div>
      <div className="case">
          Case 3
      </div>
      <div className="case">
          Case 4
      </div>
      <div className="case">
          Case 5
      </div>
    </div>
  );
}

export default Calendrier;
